import React from 'react'
import { useSelector } from 'react-redux'

const Users = () => {
  const users = useSelector(store => store.user)

  return(
    <div>
      <h2>Users</h2>
     blogs
     created
      {users.length === 0 ?
        <div/>
        :
        users.map((user) =>
          <li key={user.id}>
            {user.username} {user.blogs.length}
          </li>
        )
      }
    </div>
  )
}

export default Users
